Accounts_CustomFields_Description:
Ar trebui să fie un JSON valid, unde cheile sunt numele câmpurilor care conțin un dicționar de setări de câmp. Exemplu: <br/><code>{
"rol": {
"tip": "selectați",
"defaultValue": "student",
"opțiuni": ["profesor", "student"],
"necesar": adevărat,
"modifyRecordField": {
"matrice": adevărat,
"câmp": "roluri"
}
},
"twitter": {
"tip": "text",
"necesar": adevărat,
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
Ar trebui să fie un JSON valid în cazul în care cheile sunt limbi care conțin un dicționar de chei și traduceri. Exemplu:<br/><code>{
"en": {
"Canale": "Camere"
},
"pt": {
"Canale": "Salas"
}
}</code>
